import React from 'react'
import './TrainerCard.css'
import { Link } from 'react-router-dom'

function TrainerCard({prop}) {
    return (
        // <div className="trainer_card">
        //     <Link to="/trainermain/:id" className="link">
        //         {/* <img src={prop.img} alt="trainer" /> */}
        //         <div className="card_body">
        //             <img src={prop.img}/>
        //             <h3>{prop.name}</h3>
        //             <span>{prop.experience}</span>
        //             <button>Book</button>
        //         </div>
        //     </Link>
        // </div>
        <div className="trainercards">
            <div className="column">
                <div className="user">
                    <img src={prop.img}/>
                    <h3>{prop.name}</h3>
                </div>
                <div className="profile">
                    <h4>{prop.experience}</h4>
                </div>
            </div>
            <div className="column">
                <h4>{prop.modeoftraining1}</h4>
                <h4>{prop.modeoftraining2}</h4>
                <h4>{prop.modeoftraining3}</h4>
                <span>{prop.pricing}</span>
            </div>
        </div>
    )
}

export default TrainerCard
